import React from 'react';

function Profile({ email, collegeId, branch, gender }) {
    return (
        <div style={{ margin: 'auto', width: 500, border: "1px solid black", padding: 30, paddingTop: 20, borderRadius: 10 }}>
            <h1>Profile</h1>
            <p>Email: {email}</p>
            <p>College ID: {collegeId}</p>
            <p>Branch: {branch}</p>
            <p>Gender: {gender}</p>
        </div>
    );
}

export default Profile;
